(function(){Array.prototype.where=function(e){var t=[];for(var n=0;n<this.length;n++){if(e(this[n])){t.push(this[n])}}return t};Array.prototype.first=function(e){var t;if(e){for(var n=0;n<this.length;n++){if(e(this[n])){t=this[n];break}}}else{t=this[0]}return t};Array.prototype.any=function(e){var t=false;if(e){for(var n=0;n<this.length;n++){if(e(this[n])){t=true;break}}}else{t=this.length>0}return t};Array.prototype.select=function(e){var t=[];for(var n=0;n<this.length;n++){t.push(e(this[n]))}return t};Array.prototype.skip=function(e){var t=[];for(var n=e;n<this.length;n++){t.push(this[n])}return t};Array.prototype.take=function(e){var t=[];if(e>this.length){e=this.length}for(var n=0;n<e;n++){t.push(this[n])}return t};Array.prototype.reverse=function(){var e=[];for(var t=this.length-1;t>=0;t--){e.push(this[t])}return e}})()